# text data string se punctuation hatane ke liye aik function define kariye
def rem_punct(text):
    no_punct = ""
    for char in text:
        if char not in string.punctuation:
            no_punct = no_punct + char
    return no_punct

# text data string mein words ki tadad ginne ke liye aik function define kariye
def word_count(words):
    count = 0
    for word in words.split():
        count+=1
    return count

# words ki average length calculate karne ke liye aik function define kariye
def avg_word_length(words):
    count = 0
    total_length = 0
    for word in words.split():
        total_length += len(word)
        count+=1
    return total_length/count"
}
